INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("ヒヨリでっす♪\n元気いっぱいがんばるよ♪", "春咲 ひより", "お！\nあそこに困ってそうな人発見！", 1, 2, 0, 1, 0, 0, 0, 1001, 1.4, 0, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("みんなみたいに\nわたしも強くならなきゃ", "草野 優衣", "大切な人を\n守れるようになりたい…って", 1, 2, 0, 1, 0, 0, 0, 1002, 1.4, 0, "わ、わたし、\nなに言ってるんだろ\nあはは…", 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("フェンシングを始めてみては？", "士条 怜", "キミに必要な集中力と感性が", 1, 2, 0, 1, 0, 0, 0, 1003, 1.4, 0, "少しは磨かれると思いますよ。", 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("ねぇ、にいちゃん！", "穂高 みそぎ", "今日はなにして遊ぶ？", 1, 2, 0, 1, 0, 0, 0, 1004, 1.5, 0, "みそぎはねぇ、\nかくれんぼやりたい！", 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("風宮あかりです", "風宮 あかり", "ねぇ…", 1, 2, 0, 1, 0, 0, 0, 1006, 1.4, 0, "私といっしょに…\nいかない？", 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("出雲宮子なのー", "出雲 宮子", "プリンたべたいのー", 1, 2, 0, 1, 0, 0, 0, 1007, 1.5, 0, "食べ物の恨みは怖いのー", 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("ボクは虹村雪。", "虹村 雪", "キミもボクの美貌に\n吸い寄せられたんだね。", 1, 2, 0, 1, 0, 0, 0, 1008, 1.4, 0, "いいよ。\n見られることは運命さ…", 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("フッ…聞いて後悔するがいい！", "柊杏奈", "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 1, 2, 0, 1, 0, 0, 0, 1009, 1.4, 0, "人呼んで「疾風の冥姫」!!", 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("マホマホ王国のプリンセス、\nまほ姫どす", "姫宮 真歩", "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 1, 2, 0, 1, 0, 0, 0, 1010, 1.5, 0, "ほんまおおきにやわ～♪", 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("衣之咲璃乃です！", "衣之咲 璃乃", "生き別れたお兄ちゃんを探して\n三千世界！", 1, 2, 0, 1, 0, 0, 0, 1011, 1.4, 0, "ここで会ったが\n100年目～！", 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("私はハツネ、\n結構強いんだよ。\nきらーん☆", "柏崎 初音", "ち、超能力って…\n何のことかな～？", 1, 2, 0, 1, 0, 0, 0, 1012, 1.4, 0, "…って、お願い！\n誰にも言わないでおいて～！", 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("ちょす！\n美波鈴奈だよ～♪", "美波 鈴奈", "一応カリスマ読モJKやってまっす！", 1, 2, 0, 1, 0, 0, 0, 1016, 1.4, 0, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("はいたーい。\n喜屋武香織さー。", "喜屋武 香織", "東京は遊園地みたいなところさー", 1, 2, 0, 1, 0, 0, 0, 1017, 1.4, 0, "でも、沖縄もとってもいいとこさー", 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("支倉伊緒です。", "支倉 伊緒", "先生って呼ばれるのは\nくすぐったいから", 1, 2, 0, 1, 0, 0, 0, 1018, 1.4, 0, "イオちゃんって呼んでね。", 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("ふえ…？\nミミ、むずかしいこと\nよくわかんない…", "茜 ミミ", "あ！/\お兄ちゃ～ん\nまってよ～", 1, 2, 0, 1, 0, 0, 0, 1020, 1.5, 0, "ミミをおいてかないでぇ～", 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("あ…あの…えっと…\n栗…林…くるみ…です……", "栗林 くるみ", "あの……\nふぇ……", 1, 2, 0, 1, 0, 0, 0, 1021, 1.5, 0, "ふぇぇぇぇぇん……", 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("風宮よりです。\nあああああ！", "風宮 より", "こんな私に貴重な時間を\n割いていただき、", 1, 2, 0, 1, 0, 0, 0, 1022, 1.4, 0, "なんてありがとうございます！", 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("私、アヤネ！\nぷうきちと一緒についてってあげるね！", "北条 綾音", "おにいちゃんどこいくの？\nえ？", 1, 2, 0, 1, 0, 0, 0, 1023, 1.5, 0, "私こっち行きたいー\nね、早く早くー", 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("わっ…わっ…私、\n天野すずめといいます！", "天野 すずめ", "ふ、不束者ですが\nどうぞ末永く…って、", 1, 2, 0, 1, 0, 0, 0, 1025, 1.4, 0, "これて何か違う…\nあああすみません！", 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("……クスクス…私は\n…倉石恵理子……", "倉石 恵理子", "あなたは…運命の……\n伴侶……", 1, 2, 0, 1, 0, 0, 0, 1027, 1.4, 0, "離しませんわ………\n絶対に…!!", 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", "佐々木 咲恋", "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 1, 2, 0, 1, 0, 0, 0, 1028, 1.4, 0, "…そうでしょ？？", 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("桜井望だよ！\nよろしくねっ", "桜井 望", "ぇっと…\nキミ、私のこと知らないの?!", 1, 2, 0, 1, 0, 0, 0, 1029, 1.4, 0, "あはは、\n私もまだまだだなぁ～", 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("デケデケデンっ！", "ニノン・ジュベール", "初めまして、\n私はニノン・ジュベール申すデス！", 1, 2, 0, 1, 0, 0, 0, 1030, 1.4, 0, "ショーグン、\nワタシと一緒に天下統一デース！", 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("上喜しのぶです。\n手元のドクロが父です。", "上喜 しのぶ", "でもって私の隣にいるのが……\nえ、見えない？", 1, 2, 0, 1, 0, 0, 0, 1031, 1.4, 0, "おかしいですね……", 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("目指すはビッグな\nお笑い芸人だっぺ！", "野戸まひる", "けんども\nそれには足りないモンが…", 1, 2, 0, 1, 0, 0, 0, 1033, 1.5, 0, "そう、\nオラのボケに突っ込める相方が…！", 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", "綾瀬 ゆかり", "ちょっと緊張しちゃって…", 1, 2, 0, 1, 0, 0, 0, 1034, 1.4, 0, "ちょ\nちょっと一杯飲んできます…！", 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("氷川鏡華…です", "氷川 鏡華", "知らない人とは話しちゃいけないので", 1, 2, 0, 1, 0, 0, 0, 1036, 1.5, 0, "これ以上お話しすることは…\nないです！", 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("柏崎…栞です。", "柏崎 栞", "……あ、アラーム。", 1, 2, 0, 1, 0, 0, 0, 1038, 1.4, 0, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("ふ、双葉碧です。", "双葉 碧", "私、一人も友達がいなくて……", 1, 2, 0, 1, 0, 0, 0, 1040, 1.4, 0, "野に咲く花が、\n唯一の話相手です。", 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("三角千歌です。", "三角 千歌", "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 1, 2, 0, 1, 0, 0, 0, 1042, 1.4, 0, "そう思っています。", 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("安芸真琴だ。", "安芸 真琴", "あぁ？\nお前のそいつの仲間か？", 1, 2, 0, 1, 0, 0, 0, 1043, 1.4, 0, "う、疑ってすまなかったな…", 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("わらわこそは夜を総べる者！", "イリヤ・オーンスタイン", "生けとし生ける全ての者よ！", 1, 2, 0, 1, 0, 0, 0, 1044, 1.4, 0, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("そこで騎士は妖精を乱暴に……", "遠見 空花", "ぐふふふふ……はっ！", 1, 2, 0, 1, 0, 0, 0, 1045, 1.4, 0, "ｌク、クウカに何かご用ですか!?", 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("宮坂たまきにゃ♪\n猫はいいにゃよ？", "宮坂たまき", "自由気ままで♪\n寝て遊んで、食べてケンカして…", 1, 2, 0, 1, 0, 0, 0, 1046, 1.4, 0, "う～ん…\n猫ってホントに最高にゃ～♪", 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("大神美冬よ！", "大神 美冬", "それでは早速クエストに…", 1, 2, 0, 1, 0, 0, 0, 1048, 1.4, 0, "…と思ったら\nバイトの時間だ！\nまたあとでね！", 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("星野静流だよ！", "星野静流", "クエストもバトルも\n掃除も洗濯も", 1, 2, 0, 1, 0, 0, 0, 1049, 1.4, 0, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("アタシは玉泉美咲。", "玉泉美咲", "見ての通りの\nセクシー美少女で", 1, 2, 0, 1, 0, 0, 0, 1050, 1.5, 0, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("？？？", "リマ", "？？？？", 1, 2, 0, 1, 0, 0, 0, 1052, 1.4, 0, "？？？？", 1);
